                if(value == 1046) {
                    Instrument = "pling";
Note = 23;
Powered = false;
                }

                if(value == 1047) {
                    Instrument = "pling";
Note = 24;
Powered = true;
                }

                if(value == 1048) {
                    Instrument = "pling";
Note = 24;
Powered = false;
                }

            }
        }

        public string Instrument { get; set; } = "harp";
        public int Note { get; set; } = 0;
        public bool Powered { get; set; } = false;

        public BlockNoteBlock() {
            State = DefaultState;
        }

        public BlockNoteBlock(ushort state) : base(state) {
            if(state < MinimumState || state > MaximumState) {
                throw new ArgumentOutOfRangeException("state");
            }

            State = state;
        }

        public BlockNoteBlock(string instrument, int note, bool powered) {
            Instrument = instrument;
            Note = note;
            Powered = powered;
        }
    }
}